import React, { Component } from "react";
import "./Skill.css";

class Skill extends Component {
  render() {
    return (
      <div class="wrapper">
        <div class="card">
          <img src="./headshot-bg.png" />
        </div>
      </div>
    );
  }
}

export default Skill;
